import React from "react";
import "./login.css"

class Login extends React.Component {
 constructor(){
     super();
     this.state={
         email : "",
         password: "",
     }
 }
 handleChange = (e)=>{
    this.setState({ [e.target.name]: e.target.value });
 }
  render(){
    return (
      <div className="container" id="login-container" >
          <form>
  <div className="form-group ">

    <input type="email" name="email" className="form-control" value={this.state.email} aria-describedby="emailHelp" placeholder="Enter email"/>

  </div>
  <div className="form-group">

    <input type="password" name="password" className="form-control" value={this.state.password} placeholder="Password" />
  </div>

  <button type="submit" className="btn btn-primary">Submit</button>
</form>

      </div>
    );
  }

}

export default Login;
